 #include ESP8266WiFi.h

const char* ssid = "your_SSID";
const char* password = "your_ssid_password";
#define LeftForward 16
#define LeftBackward 14
#define RightForward 12
#define RightBackward 13
// Create an instance of the server
// specify the port to listen on as an argument
WiFiServer server(80);

void setup() {
  Serial.begin(9600);
  //lcd.begin();
  //lcd.clear();
  //lcd.setContrast(0x70);
// prepare GPIO pins
  pinMode (LeftForward,OUTPUT);
  pinMode (RightForward,OUTPUT);
  pinMode (LeftBackward,OUTPUT);
  pinMode (RightBackward,OUTPUT);
  digitalWrite(LeftForward,0);
  digitalWrite(RightForward,0);
  digitalWrite(LeftBackward,0);
  digitalWrite(LeftBackward,0);  

// Connect to WiFi networt
  WiFi.begin(ssid, password);
   Serial.println();
  Serial.println();
  Serial.print("Connecting to ");
     Serial.println(ssid);
  while (WiFi.status() != WL_CONNECTED) {
      Serial.print(".");
    delay(500);

  }
  Serial.println("");
  Serial.println("WiFi connected");
// Start the server
  server.begin();
  // Print the IP address
  IPAddress ip = WiFi.localIP();
  String address = String(ip[0]) + "." + String(ip[1]) + "." + String(ip[2]) + "." + String(ip[3]); 
  Serial.println(WiFi.localIP());
  //lcd.setCursor(0,1);
  //lcd.print(address);
}

void loop() {
  // Check if a client has connected
  WiFiClient client = server.available();
  if (!client) {
    return;
  }

  // Wait until the client sends some data
  Serial.println("new client");
  while(!client.available()){
    delay(1);
  String s = "HTTP/1.1 200 OK\r\nContent-Type: text/html\r\n\r\n&lt;!DOCTYPE HTML&gt;\r\n";
  s += "";
  s += "<input value="Forward" type="button" />";
  s += "<input value="Backward" type="button" />";
  s += "<input value="left" type="button" />";
  s += "<input value="right" type="button" />";
  s += "\n";

  // Send the response to the client
  client.print(s);
  }

  // Read the first line of the request
  String req = client.readStringUntil('\r');

    // Match the request

if (req.indexOf("/?forward") != -1)
{    digitalWrite(LeftForward,1);
     digitalWrite(RightForward,1);
delay(1000);
     digitalWrite(LeftForward,0);
     digitalWrite(RightForward,0);
}
 if (req.indexOf("/?backward") != -1)
{    digitalWrite(LeftBackward,1);
     digitalWrite(RightBackward,1);
 delay(1000);
     digitalWrite(LeftBackward,0);
     digitalWrite(RightBackward,0);
}
 if (req.indexOf("/?righ") != -1)
{    digitalWrite(LeftForward,1);
     digitalWrite(RightBackward,1);
delay(300);
     digitalWrite(LeftForward,0);
     digitalWrite(RightBackward,0);
}
 if (req.indexOf("/?left") != -1)
{   digitalWrite(LeftBackward,1);
     digitalWrite(RightForward,1);
delay(300);
     digitalWrite(LeftBackward,0);
     digitalWrite(RightForward,0);
}

else{
Serial.println("invalid request");
    //client.stop();
    return;

}
 // Send the response to the client

client.flush();
}
